    function _placeStart(Game storage _newGame) internal {
        // Start and donghaijiu
        // Initialize the board, add the Donghaijiu, and put the players there

        // Add the Donghaijiu
        // TODO: Update/eval hardcoded assumption that room 0 is the starter

        GameTile storage startTile = gameTiles.push(); // TODO: Can I make an empty one and reference it this way without the array?
        // startTile.roomId = START_ROOM_ID; // This is overwritten by the map placement loop

        uint side = smallIntBetweenVals(0, 3);
        uint position = smallIntBetweenVals(1, uint8(BOARD_SIZE-2));  //TODO: Refactor if allowing bigger boards

        uint startRow;
        uint startCol;

        // North
        if (side == 0) {
            startRow = 0;
            startCol = position;
            startTile.sDoor = 0;
        }

        // South
        if (side == 1) {
            startRow = BOARD_SIZE-1;
            startCol = position;
            startTile.nDoor = 0;
        }

        // East
        if (side == 2) {
            startRow = position;
            startCol = BOARD_SIZE-1;
            startTile.wDoor = 0;
        }

        // West
        if (side == 3) {
            startRow = position;
            startCol = 0;
            startTile.eDoor = 0;
        }

        _newGame.startPosition = Position(uint8(startRow), uint8(startCol));

        _newGame.board[startRow][startCol] = startTile;

        delete side;
        delete position; // TODO: Does this free stack space?

        // console.log("Row: ", startRow);
        // console.log("Col: ", startCol);
        // console.log(_newGame.roomList[_newGame.board[startRow][startCol].roomId].name);
