    function _buildMap(Game storage _newGame) internal {

        // BFT - inspired traversal
        uint stackCount = 0;
        uint numToPlace = _newGame.numRooms - 2; // -1 for Donghaizu and -1 for empty room
        uint availableDoors = 1; // Starts with the one out of the Donghaizu // TODO: This is kind of a hack to go down to zero when popping this tile

        uint8 doorModifier = 0;

        bool[9][9] memory found; // TODO: Hardcoded size
        found[_newGame.startPosition.row][_newGame.startPosition.col] = true;

        Position[50] memory stack; // TODO: Write a stack library?
        stack[stackCount] = _newGame.startPosition; // Start by enstacking the Donghaijiu location
        stackCount++;

        while (stackCount > 0 && numToPlace > 0) {
            // Pop the top item from the stack
            Position memory current = stack[stackCount-1];
            stackCount--;
            delete stack[stackCount]; // TODO: Confirm utility of deleting
            // Do the thing (add to map and add doors, windows, vents?)
            numToPlace--;
            availableDoors--;

            // uint newTileId = gameTiles.length;
            // GameTile storage newTile = gameTiles.push();  // TODO CRITICAL this pattern may not force pass by reference like I thought
            // newTile.roomId = 1; // TODO: Hardcoded for unexplored room
            _newGame.board[current.row][current.col].roomId = 1;
            found[current.row][current.col] = true; // TODO: This is probably generating extra doors.
            // _newGame.board[current.row][current.col] = newTile;
            // newTile.roomId = 1; // TODO: Hardcoded for unexplored room
                                // TODO: CRITICAL - Why doesn't this work??? Because it's overwriting the virtually instantiated one


            // Add vent
            if (smallIntBetweenVals(0, 99) < VENT_CHANCE) {
                _newGame.board[current.row][current.col].hasVent = true;
            }

            // Add windows
            // TODO: Deal with Windows
            // Add doors and get
            // Position[] memory neighbors;

            // TODO:  This is going to bias the order of the traversal
            for (int i = -1; i <= 1; i++) {

                for (int k = -1; k <=1; k++) {
                    // Skip diagonals and center
                    if (abs(i) == abs(k)) {
                        continue;
                    }
                    int newRow = int8(current.row) + i;
                    int newCol = int8(current.col) + k;
                    // TODO was it here or require that it's better to not use and/override
                    // Stay in bounds, reserving outside edge for Donghaijiu only
                    if (newRow < 1 ||
                        newCol < 1 ||
                        newRow > int(BOARD_SIZE-2) ||
                        newCol > int(BOARD_SIZE-2)) {
                            continue;
                    }
                    Position memory neighbor = Position(uint8(int8(newRow)), uint8(int8(newCol)));

                    if (found[neighbor.row][neighbor.col] == false) {
                        // TODO: Readd windows
                        // TODO:  This should stop us from getting trapped, but it will also bias generation
                        // if (availableDoors != 0 && smallIntBetweenVals(0, 99) < WINDOW_CHANCE) {
                        //     // TODO: DRY
                        //     found[neighbor.row][neighbor.col] = true;

                        //     _newGame.doors[_newGame.numDoors] = Door(
                        //         0,
                        //         0,
                        //         DoorStatus.WINDOW);

                        //     _newGame.numDoors++;
                        // BELOW IS BROKEN FIX LIKE FOR REGULAR DOORS!!!!
                        //     // Add the new door as the north door for this room and south door for the next room
                        //     _newGame.board[current.row][current.col].nDoor = _newGame.numDoors;
                        //     _newGame.board[neighbor.row][neighbor.col].sDoor = _newGame.numDoors;

                        // } else
                        if (availableDoors == 0 || smallIntBetweenVals(0, 99) < DOOR_CHANCE - doorModifier) {
                            doorModifier += DOOR_MOD_STEP;
                            // found[neighbor.row][neighbor.col] = true;

                            stack[stackCount] = neighbor;
                            stackCount++;
                            availableDoors++;

                            _newGame.doors[_newGame.numDoors] = Door(
                                smallIntBetweenVals(0, MAX_DOOR_STR),
                                smallIntBetweenVals(0, MAX_DOOR_STR),
                                DoorStatus.CLOSED);
                            // NUM DOORS IS INCREMENTED BELOW AFTER DOOR IS ADDED TO NEIGHBOR!!!

                            // TODO: DRY This?
                            // TODO:  Overkill on if statemenents.  Figure out why the && is needed to prevent incorrect placing 90 degree doors
                            // console.log("Start adding doors");
                            // TODO: Verify the third && prevents extra door generation
                            if (i == -1 && k == 0 && _newGame.board[current.row][current.col].nDoor == 0) {
                                // North
                                // console.log("Added north", current.row, current.col);
                                _newGame.board[current.row][current.col].nDoor = _newGame.numDoors;
                                _newGame.board[neighbor.row][neighbor.col].sDoor = _newGame.numDoors;
                            } else if (i == 1 && k == 0 && _newGame.board[current.row][current.col].sDoor == 0) {
                                // South
                                // console.log("Added south", current.row, current.col);
                                _newGame.board[current.row][current.col].sDoor = _newGame.numDoors;
                                _newGame.board[neighbor.row][neighbor.col].nDoor = _newGame.numDoors;
                            } else if (k == 1 && i == 0 && _newGame.board[current.row][current.col].eDoor == 0) {
                                // East
                                // console.log("Added east", current.row, current.col);
                                _newGame.board[current.row][current.col].eDoor = _newGame.numDoors;
                                _newGame.board[neighbor.row][neighbor.col].wDoor = _newGame.numDoors;
                            } else if (k == -1 && i == 0 && _newGame.board[current.row][current.col].wDoor == 0){
                                // West
                                // console.log("Added west", current.row, current.col);
                                _newGame.board[current.row][current.col].wDoor = _newGame.numDoors;
                                _newGame.board[neighbor.row][neighbor.col].eDoor = _newGame.numDoors;
                            } else {
                                console.log("SHOULDN'T BE HERE!!!");
                                console.logInt(i);
                                console.logInt(k);
                                revert();
                            }
                            // console.log("End adding doors");
                            _newGame.numDoors++;
                        } else {
                            doorModifier = 0;
                        }
                    }

                }
            }
        }
        // Cleanup Tasks

        // TODO Detect and prevent failure to deploy all tiles
        console.log("Unplaced rooms: ", numToPlace);
        require(numToPlace == 0, "Map generation broke!!!");

        // Reset Donghaijiu ID (Was changed by map building)
        _newGame.board[_newGame.startPosition.row][_newGame.startPosition.col].roomId = uint8(START_ROOM_ID);

        //
        // TODO reset donghaijiu and add sig detected
    }


    // function _addDoor(Game storage _newGame) internal returns (Door memory) {

    // }

    function _getUnusedRoomId(Game storage _game) internal returns (uint8) {
        // TODO: Explore other ways of doing use once
        uint8 roomId = smallIntBetweenVals(2, _game.numRooms);

        while (_game.usedRooms[roomId] == true) {
            if (roomId == _game.numRooms-1) {
                roomId = uint8(START_ROOM_ID) + 1; // TODO: Semi-Hardcoded to account for empty and donghaijiu
            } else {
                roomId++;
            }
        }

        return roomId;
    }
    // function debugGetCurrentRoomTilesLength() public view returns(uint256){
    //     uint length = roomTileContract.getNumRoomTiles();
    //     mapping (uint => RoomTiles.RoomTile) storage currentRoomTiles;
    //     _getCurrentRoomTiles(currentRoomTiles);
