    function _getCurrentRoomTiles(mapping (uint => RoomTiles.RoomTile) storage _roomList) internal returns (uint) {
        // TODO: this seems much more maintainable/developable than putting it in RoomTiles.sol
        // TODO: However, it breaks if you do it twice in a unit test
        uint number = roomTileContract.getNumRoomTiles();
        for(uint i = 0; i < number; i++) {
            _roomList[i] = roomTileContract.extGetRoomTile(i);
        }
        return number;
    }

    function testGettingRoomTiles() public view returns (uint[] memory) {
        uint[] memory numbers = new uint[](2);

        for (uint i = 0; i < numbers.length; i++) {
            numbers[i] = roomTileContract.getNumRoomTiles();
        }
        return numbers;
    }

    function extGetGameTile(uint _gameId, uint _row, uint _col) public view returns (GameTile memory) {
        return games[_gameId].board[_row][_col];
    }

    function extGetBoard(uint _gameId) public view returns (GameTile[][] memory) {
        GameTile[][] memory board = new GameTile[][](BOARD_SIZE);
        for (uint i = 0; i < BOARD_SIZE; i++) {
            board[i] = new GameTile[](BOARD_SIZE);
        }

        for (uint row = 0; row < BOARD_SIZE; row++) {
            for (uint col = 0; col < BOARD_SIZE; col++) {
                board[row][col] = games[_gameId].board[row][col];
            }
        }

        return board;
    }

    function extGetDoors(uint _gameId) public view returns (Door[] memory) {
        Door[] memory doors = new Door[](games[_gameId].numDoors);
        for (uint i = 0; i < doors.length; i++) {
            doors[i] = games[_gameId].doors[i];
        }

        return doors;
    }

